import React from "react";

function add(a,b){
    let sum=a+b;
    return sum;
}
function subtract(a,b){
    let sub=a-b;
    return sub;
}
function multiply(a,b){
    let mul=a*b;
    return mul;
}
function division(a,b){
    let div=a/b;
    return div;
}
export{add,subtract,multiply,division};
